Campaigns_over_time__1.query:
q = load "${App.Datasets.FscDemoCampaignMember.FullyQualifiedName}";
Campaigns = load "${App.Datasets.FscDemoCampaign.FullyQualifiedName}";
responded = filter q by 'HASRESPONDED' == "true";
result = group Campaigns by ('STARTDATE_Year','STARTDATE_Month') left, q by ('CAMPAIGNSTARTDATE_Year', 'CAMPAIGNSTARTDATE_Month') left, responded by ('CAMPAIGNSTARTDATE_Year', 'CAMPAIGNSTARTDATE_Month');
result = foreach result generate Campaigns.'STARTDATE_Year' + "~~~" + Campaigns.'STARTDATE_Month' as 'CAMPAIGNSTARTDATE_Year~~~CAMPAIGNSTARTDATE_Month', unique(Campaigns.'ID') as '# Campaigns', count(q) as 'Total Invited', count(responded) as 'Total Attended';
result = order result by 'CAMPAIGNSTARTDATE_Year~~~CAMPAIGNSTARTDATE_Month' asc;

Avg_attendance_rate_1.query:
q = load "${App.Datasets.FscDemoCampaign.FullyQualifiedName}";
members = load "${App.Datasets.FscDemoCampaignMember.FullyQualifiedName}";
q = group q by 'ID' left, members by 'CAMPAIGNID';
q = foreach q generate sum(q.'NUMBEROFRESPONSES') as 'NUMBEROFRESPONSES', count(members) as 'NUMBERSENT';
result = group q by all;
result = foreach result generate sum('NUMBEROFRESPONSES') as 'A', sum(q.'NUMBERSENT') as 'B';
result = foreach result generate 'A', 'B', round(coalesce(A/B,0),4) as 'Attendance Rate';

Campaign_Attendees_1.query:
q = load "${App.Datasets.FscDemoCampaignMember.FullyQualifiedName}";
q = foreach q generate 'CAMPAIGNNAME' as 'CAMPAIGNNAME', 'CAMPAIGNSTARTDATE' as 'CAMPAIGNSTARTDATE', 'CAMPAIGNSTATUS' as 'CAMPAIGNSTATUS', coalesce('CONTACTEMAIL','LEADEMAIL') as 'Email', coalesce('CONTACTMOBILEPHONE','LEADPHONE') as 'Phone', coalesce('CONTACTNAME','LEADNAME') as 'Name', 'HASRESPONDED' as 'Attended?', 'TYPE' as 'TYPE';
q = limit q 1000;

Campaign_conversion__1.query:
q = load "${App.Datasets.FscDemoCampaign.FullyQualifiedName}";
members = load "${App.Datasets.FscDemoCampaignMember.FullyQualifiedName}";
q = group q by 'ID' left, members by 'CAMPAIGNID';
q = foreach q generate q.'ID' as 'ID', first(q.'NAME') as 'NAME', sum(q.'NUMBEROFWONOPPORTUNITIES') as 'NUMBEROFWONOPPORTUNITIES', count(members) as 'NUMBERSENT';
q = group q by 'NAME';
q = foreach q generate 'NAME' as 'NAME', coalesce((sum('NUMBEROFWONOPPORTUNITIES') / sum('NUMBERSENT')),0) as 'Conversion Rate';
q = order q by 'Conversion Rate' desc;

Campaign_cost_of_con_1.query:
q = load "${App.Datasets.FscDemoCampaign.FullyQualifiedName}";
q = group q by 'NAME';
q = foreach q generate 'NAME' as 'NAME', coalesce(sum(q.'ACTUALCOST')/sum(q.'NUMBEROFWONOPPORTUNITIES'),0) as 'Cost per conversion';
q = order q by 'Cost per conversion' asc;
q = limit q 2000;

Cost_Vs_Conversion_1.query:
q = load "${App.Datasets.FscDemoCampaign.FullyQualifiedName}";
q = group q by 'NAME';
q = foreach q generate 'NAME' as 'NAME', sum('NUMBEROFWONOPPORTUNITIES') as 'Conversion', sum('ACTUALCOST') as 'Cost', sum('NUMBEROFRESPONSES') as 'Attendees';
q = order q by 'NAME' asc;
q = limit q 2000;

Details_Table_1.query:
q = load "${App.Datasets.FscDemoCampaign.FullyQualifiedName}";
members = load "${App.Datasets.FscDemoCampaignMember.FullyQualifiedName}";
q = group q by 'ID' left, members by 'CAMPAIGNID';
q = foreach q generate q.'ID' as 'ID', first(q.'NAME') as 'NAME', first(q.'STARTDATE') as 'STARTDATE', sum(q.'ACTUALCOST') as 'ACTUALCOST',sum(q.'NUMBEROFRESPONSES') as 'NUMBEROFRESPONSES', count(members) as 'NUMBERSENT', sum(q.'NUMBEROFWONOPPORTUNITIES') as 'NUMBEROFWONOPPORTUNITIES';
result = group q by ('ID');
result = foreach result generate q.'ID' as 'ID', first(q.'NAME') as 'NAME', first(q.'STARTDATE') as 'STARTDATE', sum(q.'ACTUALCOST') as 'Campaign Cost', sum(q.'NUMBERSENT') as '# Invited', sum(q.'NUMBEROFRESPONSES') as '# Attended', sum(q.'NUMBEROFWONOPPORTUNITIES') as '# Converted';
result = foreach result generate 'NAME', 'STARTDATE', 'Campaign Cost', '# Invited', '# Attended', '# Converted', round(('# Converted'/'# Invited'),4) as 'Conversion Rate', 'Campaign Cost'/'# Converted' as 'Cost per conversion', round(('# Attended'/'# Invited'),4) as 'Attendance Rate';
result = order result by ('NAME' asc);
result = limit result 2000;

Average_conversion_r_1.query:
q = load "${App.Datasets.FscDemoCampaign.FullyQualifiedName}";
members = load "${App.Datasets.FscDemoCampaignMember.FullyQualifiedName}";
q = group q by 'ID' left, members by 'CAMPAIGNID';
q = foreach q generate sum(q.'NUMBEROFWONOPPORTUNITIES') as 'NUMBEROFWONOPPORTUNITIES', count(members) as 'NumberSent';
q = group q by all;
q = foreach q generate round(coalesce((sum('NUMBEROFWONOPPORTUNITIES') / sum('NumberSent')),0),4) as 'Average Conversion Rate';

Attendees_by_type_1.query:
q = load "${App.Datasets.FscDemoCampaignMember.FullyQualifiedName}";
responded = filter q by 'HASRESPONDED' == "true";
result = group q by 'TYPE' left, responded by 'TYPE';
result = foreach result generate q.'TYPE' as 'TYPE', coalesce(count(q),0) as 'Invited', coalesce(count(responded),0) as 'Attended';
